Person::Person(string fn, string ln, string g, string age,
    string email, string ph, string edu, string occ,
    string exp, string sal, string mart, string chc)
    : JDObjectInterface()
{
    firstName = fn;
    lastName = ln;
    gender = g;
    this->age = age;
    this->email = email;
    phone = ph;
    education = edu;
    occupation = occ;
    experience = exp;
    salary = sal;
    martialStatus = mart;
    numberOfChildren = chc;




    //instanceCounter++;
    //setObjectID(id);
}
